import react from 'react'


const Registro = () => {
const registroForm = () => <p>Formulario Registro</p>
     return (
        <div className="container p-5">
           <div className="row">
               <div className=".col-md-6.offset-md-3">
                   <h4>registro</h4>
                   {registroForm()}
               </div>
           </div>
        </div>
     );
     }





export default Registro;
